import React from 'react'
import './Card.css' 

const Card = (props) => {
  return (
    <div id="details">
        <div id='stationdetails'>
            <div id='fromsection'></div>
            <div id='timedetails'></div>

        </div>
    </div>
  )
}

export default Card
